import moment from "moment";
export const planning = [
    {
        start: moment("2024-06-13T16:00:00").toDate(),
        end: moment("2024-06-13T16:30:00").toDate(),
        "matiere":"React",
        "debut":"9h00",
        "fin": "13h"
    },
    {
        "matiere":"Docker",
        "debut":"14h00",
        "fin": "16h00"
    },
    {
        "matiere":"Travail Personel",
        "debut":"15h00",
        "fin": "16h00"
    },
    {
        "matiere":"Gestion de projet",
        "debut":"16h",
        "fin": "18h"
    }
]
